import React from "react";
import "./Home.css";

function Home() {
  return (
    <div className="home">
      <div className="home_header">
        <div className="home_headerLeft"></div>
        <div className="home_headerRight"></div>
      </div>
      <div className="home_body"></div>
    </div>
  );
}

export default Home;
